function hideCrate() {
    "object" == typeof crateVar ? crateVar.hide() : null
}

function showCrate() {
    "object" == typeof crateVar ? crateVar.show() : null
}

function botRightCrate() {
    "object" == typeof crateVar ? crateVar.setOptions({
        location: ["bottom", "right"]
    }) : null
}

function botRightUpCrate() {
    "object" == typeof crateVar ? crateVar.setOptions({
        location: [-70, "right"]
    }) : null
}

function hideChatroom() {
    document.querySelector("#jinwoochat") ? document.querySelector("#jinwoochat").style.setProperty("display", "none", "important") : null
}

function showChatroom() {
    document.querySelector("#jinwoochat") ? document.querySelector("#jinwoochat").style.setProperty("display", null, "important") : null
}

function hideOnesignal() {
    document.querySelector("#onesignal-bell-container") ? document.querySelector("#onesignal-bell-container").style.setProperty("display", "none", "important") : null
}

function showOnesignal() {
    document.querySelector("#onesignal-bell-container") ? document.querySelector("#onesignal-bell-container").style.setProperty("display", null, "important") : null
}

function hideArc() {
    document.querySelector("#arc-widget-container") ? document.querySelector("#arc-widget-container").style.setProperty("display", "none", "important") : null
}

function showArc() {
    document.querySelector("#arc-widget-container") ? document.querySelector("#arc-widget-container").style.setProperty("display", null, "important") : null
}

function onClickSearch() {
    for (var a = document.querySelectorAll(".search-switch"), b = function() {
            hideCrate(), hideArc(), hideOnesignal(), hideChatbro()
        }, c = 0; c < a.length; c++) a[c].addEventListener("click", b, !1);
    for (var d = document.querySelectorAll(".search-close-switch"), e = function() {
            showCrate(), showArc(), showOnesignal(), showChatbro()
        }, c = 0; c < d.length; c++) d[c].addEventListener("click", e, !1)
}

function chatbroListener() {
    parseInt(document.getElementById("isDesktop").value) ? ($(document).on("click", ".chatbro_minimize_button", function() {
        botRightUpCrate()
    }), $(document).on("click", ".chatbro_minimized_header", function() {
        botRightCrate()
    }), setTimeout(() => {
        $(".chatbro_opacity").hasClass("chatbro_chat") ? botRightCrate() : botRightUpCrate()
    }, 1e3)) : ($(document).on("click", ".chatbro_minimize_button", function() {
        showCrate(), showArc(), showOnesignal()
    }), $(document).on("click", ".chatbro_minimized_header", function() {
        hideCrate(), hideArc(), hideOnesignal()
    }))
}
$(window).on("load", function() {
    onClickSearch()
});